import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
  return (
    <div>
      <h1>Welcome to the Order Management System</h1>
      <div>
        <Link to="/customerorder">
          <button>Customer Order</button>
        </Link>
      </div>
      <div>
        <Link to="/adminorder">
          <button>Admin Order</button>
        </Link>
      </div>
    </div>
  );
}

export default HomePage;
